import { useState } from 'react';
const Prices = (props) => {
    const [Currency, setCurrency] = useState('USD');

    return (
        <div className="container">
            <h3>Bit coin rate for today {props.data.time.updated}</h3>
            <ul className="list-group">
                <li className="list-group-item">Bitcoin rate for {props.data.bpi.[Currency].description} <span className="badge badge-primary">{props.bpi[Currency].code}</span>
                    <strong>{props.data.bpi.[Currency].rate}</strong>
                </li>
            </ul>
            <select onChange={e => setCurrency({ Currency: e.target.value })} className="form-control">
                <option value="USD">USD</option>
                <option value="GBP">GBP</option>
                <option value="EUR">EUR</option>
            </select>
        </div>
    )

}
export default Prices;
